func TestConvertBase64ToImage(t *testing.T) {
	str, err := ConvertBase64ToImage(content, "/tmp/201808", "http://127.0.0.1/static/201808")
	if err != nil {
		t.Fatal(err)
	}
	if str != `src="http://127.0.0.1/static/201808/5b5fadbc13389e93cf72502dec1208b9.png"` {
		t.FailNow()
	}
}

